import unittest

from pyetherscan import client, response


class BaseClientTestCase(unittest.TestCase):

    def setUp(self):
        self.client = client.Client()


class TestAccountEndpoint(BaseClientTestCase):

    def test_get_single_balance(self):
        expected_response = {u'status': u'1', u'message': u'OK', u'result': u'748997604382925139479303'}
        address = '0xde0b295669a9fd93d5f28d9ec85e40f4cb697bae'
        result = self.client.get_single_balance(address)

        self.assertEqual(response.SingleAddressBalanceResponse, type(result))
        self.assertEqual(expected_response, result.etherscan_response)
        self.assertEqual(200, result.response_status_code)
        self.assertEqual('1', result.status)
        self.assertEqual('OK', result.message)
        self.assertEqual(748997604382925139479303.0, result.balance)

    def test_get_multi_balance(self):
        expected_response = {u'status': u'1', u'message': u'OK', u'result': [{u'account': u'0xddbd2b932c763ba5b1b7ae3b362eac3e8d40121a', u'balance': u'40807168564070000000000'}, {u'account': u'0x63a9975ba31b0b9626b34300f7f627147df1f526', u'balance': u'332567136222827062478'}, {u'account': u'0x198ef1ec325a96cc354c7266a038be8b5c558f67', u'balance': u'12005264493462223951724'}]}
        addresses = ['0xddbd2b932c763ba5b1b7ae3b362eac3e8d40121a','0x63a9975ba31b0b9626b34300f7f627147df1f526','0x198ef1ec325a96cc354c7266a038be8b5c558f67']
        result = self.client.get_multi_balance(addresses)

        self.assertEqual(response.MultiAddressBalanceResponse, type(result))
        self.assertEqual(expected_response, result.etherscan_response)
        self.assertEqual(200, result.response_status_code)
        self.assertEqual('1', result.status)
        self.assertEqual('OK', result.message)

        balances = {u'0x198ef1ec325a96cc354c7266a038be8b5c558f67': 1.2005264493462224e+22, u'0x63a9975ba31b0b9626b34300f7f627147df1f526': 3.3256713622282705e+20, u'0xddbd2b932c763ba5b1b7ae3b362eac3e8d40121a': 4.080716856407e+22}
        self.assertEqual(balances, result.balances)

    def test_get_transactions_by_address(self):
        address = '0xde0b295669a9fd93d5f28d9ec85e40f4cb697bae'
        result = self.client.get_transactions_by_address(address)

        self.assertEqual(response.TransactionsByAddressResponse, type(result))
        # self.assertEqual(expected_response_result_sorted, etherscan_response_sorted)
        self.assertEqual(200, result.response_status_code)
        self.assertEqual('1', result.status)
        self.assertEqual('OK', result.message)

    def test_get_transaction_by_hash(self):
        expected_response = {u'status': u'1', u'message': u'OK', u'result': [{u'contractAddress': u'', u'from': u'0x2cac6e4b11d6b58f6d3c1c9d5fe8faa89f60e5a2', u'timeStamp': u'1466489498', u'gas': u'2300', u'errCode': u'', u'value': u'7106740000000000', u'blockNumber': u'1743059', u'to': u'0x66a1c3eaf0f1ffc28d209c0763ed0ca614f3b002', u'input': u'', u'type': u'call', u'isError': u'0', u'gasUsed': u'0'}]}
        hash = '0x40eb908387324f2b575b4879cd9d7188f69c8fc9d87c901b9e2daaea4b442170'
        result = self.client.get_transaction_by_hash(hash)
        transaction = {u'contractAddress': u'', u'from': u'0x2cac6e4b11d6b58f6d3c1c9d5fe8faa89f60e5a2', u'timeStamp': u'1466489498', u'gas': u'2300', u'errCode': u'', u'value': u'7106740000000000', u'blockNumber': u'1743059', u'to': u'0x66a1c3eaf0f1ffc28d209c0763ed0ca614f3b002', u'input': u'', u'type': u'call', u'isError': u'0', u'gasUsed': u'0'}

        self.assertEqual(response.TransactionsByHashResponse, type(result))
        self.assertEqual(expected_response, result.etherscan_response)
        self.assertEqual(200, result.response_status_code)
        self.assertEqual('1', result.status)
        self.assertEqual('OK', result.message)
        self.assertEqual(transaction, result.transaction)

